			shellScript = "# Set your app's minimum target version here\nTARGET_IOS_VERSION=\"17.0\"\n\n# Find all .framework bundles in the app's Frameworks directory\nfind \"${BUILT_PRODUCTS_DIR}/${FRAMEWORKS_FOLDER_PATH}\" -name '*.framework' -type d | while read -r FRAMEWORK\ndo\n  INFO_PLIST_PATH=\"${FRAMEWORK}/Info.plist\"\n  if [ -f \"$INFO_PLIST_PATH\" ]; then\n    echo \"Updating MinimumOSVersion for ${FRAMEWORK##*/}\"\n    # Set or update the MinimumOSVersion key in the framework's Info.plist\n    /usr/libexec/PlistBuddy -c \"Set :MinimumOSVersion $TARGET_IOS_VERSION\" \"$INFO_PLIST_PATH\" || /usr/libexec/PlistBuddy -c \"Add :MinimumOSVersion string $TARGET_IOS_VERSION\" \"$INFO_PLIST_PATH\"\n  fi\ndone\n";
